<template>
	<div id='newCAContent'>
		<img class="bgImg" :src="bg_ca_top" style="width:100%;height:200px;">
		<div class="caContent">
			<p class="text">
				<span>{{showTextBl}}</span>
				<span style="color:#f00;">{{showTextRed}}</span>
				<span>{{showTextBlN}}</span>
			</p>
			<p class="left"></p>
			<p class="right"></p>
			<p class="img">
				<img v-for="item in showImg" :src="item" style="width:30px;" />
			</p>
			<p class="bg">{{showText[code]}}</p>
			<canvas id='newCanvas'>您当前浏览器不支持canvas，建议更换浏览器！</canvas>
			<div class="btn">
				<button @click='Output()'>确定</button>
				<button @click='ClearCanvas'>清空</button>
				<button @click='Canvas_goBack'>返回</button>
			</div>
		</div>
	</div>
</template>
<script>
	export default {
		name: 'newCAS',
		props: ['value'],
		data() {
			return {
				code: 0,
				ImgSrc: '',
				showText: '本人已阅读保险条款、产品说明书和投保提示书，了解本产品的特点和保单利益的不确定性。',
				showTextBl: '',
				showTextRed: '本',
				showTextBlN: '人已阅读保险条款、产品说明书和投保提示书，了解本产品的特点和保单利益的不确定性。',
				showImg: [],
				screenWidth: window.screen.width,
				screenHeight: window.screen.height,
				waitfor: null,
				bg_ca_top:'data:image/png;base64,'
			}
		},
		watch: {
			'value.context_id': {
				handler(val, oldval) {
					this.init()
					if(val == '30') {
						this.showText = '本人已阅读保险条款、产品说明书和投保提示书，了解本产品的特点和保单利益的不确定性。'
						this.showTextBl = ''
						this.showTextRed = this.showText[0]
						this.showTextBlN = this.showText.slice(1)

					} else if(val == '31') {
						this.showText = '本人已知晓保险从业人员不得违规销售非保险金融产品，由此造成的风险自行承担。'
						this.showTextBl = ''
						this.showTextRed = this.showText[0]
						this.showTextBlN = this.showText.slice(1)
					}
				},
				deep: true
			},
			showImg: {
				handler(val, oldval) {
					this.code = val.length
					let showTextBl = ''
					let showTextRed = ''
					let showTextBlN = ''
					for(let i = 0; i < this.showText.length; i++) {
						if(i < this.code) {
							showTextBl += this.showText[i]
						} else if(i == this.code) {
							showTextRed += this.showText[i]
						} else {
							showTextBlN += this.showText[i]
						}
					}
					this.showTextBl = showTextBl
					this.showTextRed = showTextRed
					this.showTextBlN = showTextBlN
					if(this.showImg.length == this.showText.length) {
						alert_n22.alert("提示", "签字已完成,请点击确定上传签字", "确定")
					}
				},
				deep: true
			},
		},
		mounted() {

		},
		methods: {
			offset: function(a) {
				var c, d, b = "undefined",
					e = {
						top: 0,
						left: 0
					},
					f = a,
					g = f && f.ownerDocument;
				if(g) return c = g.documentElement, typeof f.getBoundingClientRect !== b && (e = f.getBoundingClientRect()), d = JQuery_Capable.getWindow(g), {
					top: e.top + (d.pageYOffset || c.scrollTop) - (c.clientTop || 0),
					left: e.left + (d.pageXOffset || c.scrollLeft) - (c.clientLeft || 0)
				}
			},
			init() {
				let canvas = document.getElementById('newCanvas')
				let ctx = canvas.getContext('2d');
				let _x = 0,
					_y = 0,
					x = 0,
					y = 0;
				canvas.width = this.screenWidth - 62;
				canvas.height = this.screenWidth - 62;
				//canvas.height = this.screenHeight - 282;
				$('.bg').css('width', this.screenWidth - 62)
				$('.bg').css('height', this.screenWidth - 62)
				//$('.bg').css('height', this.screenHeight - 282)
				let than = this
				canvas.addEventListener('touchstart', function(e) { // 开始绘制
					if(this.waitfor != null) {
						clearTimeout(this.waitfor)
					}
					e.preventDefault();
					_x = e.touches[0].pageX,
						_y = e.touches[0].pageY;
					ctx.beginPath(); // 路径开始
					ctx.lineWidth = 5
					let b = than.offset(e.target)
					ctx.moveTo(_x - b.left, _y - b.top);
					this.addEventListener('touchmove', function(e) { // 路径移动
						x = e.touches[0].pageX,
							y = e.touches[0].pageY;
						let b = than.offset(e.target)
						ctx.lineTo(x - b.left, y - b.top);
						ctx.stroke();
					});
				});
				console.log('============', canvas.width, canvas.height)
				let that = this
				canvas.addEventListener('touchend', function(e) {
					this.waitfor = setTimeout(() => {
						let canvas = document.getElementById('newCanvas')
						let ctx = canvas.getContext('2d')
						let oImg = new Image()
						ctx.drawImage(oImg, 0, 0);
						let imgSrc = canvas.toDataURL('image/png')
						//获取整体画板的像素个数
						let data = ctx.getImageData(0,0,canvas.width, canvas.height).data
						let threshold = 150 //可通过像素阈值 
						let pixel = 0
						//计数有效像素点
						for(let i=0;i<data.length;i++){
							if(data[i] == 255 && pixel < threshold){
								pixel ++
							}
						}
						//不通过阈值
						if(pixel < threshold){
							return
						}
						//空对象
						let blank = document.createElement('canvas')
						let blankctx = blank.getContext("2d")
						blank.width = canvas.width
						blank.height = canvas.height
						blankctx.drawImage(new Image(), canvas.width, canvas.height)
						let blankSrc = blank.toDataURL('image/png')
						//console.log('blankSrc===>', blankSrc)
						if(imgSrc == blankSrc) {
							console.log('===>未签字')
						} else if(that.showImg.length < that.showText.length) {
							that.showImg.push(imgSrc)
							ctx.clearRect(0, 0, canvas.width, canvas.height);
						} else {
							alert_n22.alert("提示", "签字已完成,请点击确定上传签字", "确定")
							ctx.clearRect(0, 0, canvas.width, canvas.height);
						}
						document.getElementsByClassName('img')[0].scrollTop = document.getElementsByClassName('img')[0].scrollHeight+20 
					}, 3000)
				});
			},
			pt(rownum, colnum, len, i_w, i_h, paths, result) {
				let x = 0
				let y = 0
				let canvas = document.createElement('canvas')
				let ctx = canvas.getContext('2d');
				canvas.width = colnum * i_w;
				canvas.height = rownum * i_h;
				for(let i = 0; i < len; i++) {
					(function(i) {
						let img = new Image();
						let version = utils.common.getiPhoneVersion()
						if(version&&version.indexOf('10.1')>-1){
						}else{
							img.crossOrigin = 'Anonymous';
						}
						img.onload = function() {
							let new_w = x * i_w
							let new_h = y * i_h
							console.log(new_w)
							console.log(new_h)
							ctx.drawImage(img, new_w, new_h);
							x += 1
							if(x == colnum) {
								x = 0
								y += 1
							}
							if(i == len - 1 && result != null) {
								result(canvas.toDataURL('image/png'))
							}
						}
						img.src = paths[i]
						img.width = i_w
					})(i)
				}
			},
			Output() {
				if(this.showImg.length == this.showText.length) {
					this.pt(2, 20, this.showText.length, this.screenWidth - 62, this.screenWidth - 62, this.showImg, (result) => {
						//console.log(result)
						this.value.image = result
						this.imageUpload(this.value.context_id, result)
					})
				} else {
					alert_n22.alert("提示", "请完成签字", "确定")
				}
			},
			ClearCanvas() {
				this.showImg.splice(this.showImg.length - 1, 1);
			},
			Canvas_goBack() {
				let canvas = document.getElementById('newCanvas')
				let ctx = canvas.getContext('2d')
				ctx.clearRect(0, 0, canvas.width, canvas.height);
				this.value.isCASOpen = !this.value.isCASOpen
			},
			imageUpload: function(context_id, image) {
				if(image != undefined && image != "") {
					let requ = {
						"upload": {
							"agentCode": this.value.agentCode || '',
							"applyCode": this.value.applyCode,
							"orderId": this.value.orderId,
							"policyCode": "",
							"deviceNo": "INSURE",
							"imageList": [{
								"imageType": context_id,
								"imageName": "签字照片",
								"imageByte": image.substring(22, image.length)
							}]
						}
					}
					if(requ.upload.imageList[0].imageByte != undefined && requ.upload.imageList[0].imageByte != "") {
						utils.http.postFast('MOUPLOAD', requ, (body) => {
							if(body.resultCode == "0") {
								this.Canvas_goBack()
							} else {
								alert_n22.alert("提示", body.resultMessage, "确定")
								this.value.isCASOpen = !this.value.isCASOpen
							}
						})
					}
				}
			},
		}
	}
</script>
